import photo1 from "../../components/assets/photo1.jpg";
import photo2 from "../../components/assets/photo5.jpg";
import photo3 from "../../components/assets/photo3.jpg";

function PhotoGalleryView() {
  return (
    <>
      <NavBar text1="PowrÃ³t" text2="O mnie" text3="Kontakt" />
      <div className="photoGalleryView__container">
        <div className="photoGalleryView__container--div">
          <img src={photo1} alt="" />
          <h3>Psiaki ze schroniska</h3>
        </div>
        <div className="photoGalleryView__container--div">
          <img src={photo2} alt="" />
          <h3>Psiaki ze schroniska</h3>
        </div>
        <div className="photoGalleryView__container--div">
          <img src={photo3} alt="" />
          <h3>Psiaki ze schroniska</h3>
        </div>
      </div>
    </>
  );
}

export default PhotoGalleryView;
